import web3 from './web3';
import ElectionFactory from './Build/ElectionFact.json';

// Make sure your JSON file has these exact properties
const contractABI = ElectionFactory.abi;
const contractAddress = '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8';

// Simple contract instance
const instance = new web3.eth.Contract(contractABI, contractAddress);

export default instance;
